import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';
export class Menu extends Component {
    render() {
        return (
            <div>
                <NavLink to="/">
                    Home
                </NavLink>
                <NavLink to="/portfolio">
                    Portfolio
                </NavLink>
                <NavLink to="/contact">
                    Contact
                </NavLink>       
            </div>
        )
    }
}

export default Menu
